import React from 'react';
import './App.css';
import Classifier from './components/Classifier/Classifier';

function App() {
  return (
      <div className='App'>
        <Switch>
          <Route exact path='/' component={Classifier} />

          <Route exact path='*' component={Classifier} />
        </Switch>

      </div>

  );
}

export default App;
